import react from "react";
import {BrowserRouter, Switch, Route} from "react-router-dom";

const App = () =>{
    return(
        <>
            <BrowserRouter>
                <Switch>
                    <Route path="/">
                        HOME
                    </Route>
                    <Route path="/">
                        REGISTER
                    </Route>
                </Switch>
            </BrowserRouter>
        </>
    );
}
export default App;
